{
    "api_version": 3,
    "id": 6522046,
    "data": {
        "categories": [
            {
                "name": "miner",
                "title": "Miner",
                "parent": "malware",
                "description": "Miners are particular malware that make use of a target to perform long-running, CPU-intensive tasks. Most often, they are involved with crypto currency mining. An attacker will use a network of bots that reside across multiple hosts, each one using the host CPU to 'mine' for crypto currency. In a sense, they are using the target system to make digital money. When the miner discovers something useful, the information is sent back to the attacker, who collects the currency. Miners result in increased wear on the CPU and sluggish performance of the target system."
            },
            {
                "name": "exfiltration",
                "title": "Exfiltration",
                "parent": "network",
                "description": "Exfiltration indicators trigger when some information or files from the system are sent to a remote location. This is beyond simple information needed for a network connection. Legitimate programs may do this for actions like sending an email or sending data that the user entered through a webpage. Malicious programs do this to gather information about the system or to steal data from the user."
            },
            {
                "name": "phishing",
                "title": "Phishing",
                "parent": "malware",
                "description": "Phishing is the use of an email or document that is designed to trick the user into clicking a link or launching embedded content. Most often, the message states that the user has won something or needs to provide attention to a problem. Some will mimic logos for well-known institutions, such as banks or online programs. The link does not take them to the stated location, but instead directs them to a malicious web location. This webpage may masquerade as a legitimate service for credential theft or it may download material to the host system."
            },
            {
                "name": "static",
                "title": "Static",
                "parent": null,
                "description": "Items within Static categories are those that can be identified through detailed analysis of the file alone. These are useful to traditional Anti-Virus solutions because it can be done relatively quickly and without the cost of a full virtualized execution. They can be tricked through obfuscation or limited if the file is attempting to access remote material. In general, a combination of static and dynamic indicators provides the best evidence of malicious intent."
            },
            {
                "name": "antivirus",
                "title": "Anti-Virus",
                "parent": "static",
                "description": "Anti-Virus indicators trigger when a traditional AV product scan of a file produces some result. This might be for a single well-trusted engine, or it may be a combination of several products. Online solutions such as VirusTotal provide the latter, while Cisco maintained tools provide the former."
            },
            {
                "name": "heuristic",
                "title": "Heuristic",
                "parent": "sample",
                "description": "Heuristic indicators trigger when one of the Threat Grid heuristic models identifies patterns associated with malicious activity. These engines collect information from other indicators or various areas of the sample data. This data is passed to a machine-learning model, which analyzes the data for patterns that are not necessarily visible to a human analyst. The models are updated frequently and serve as another means of detection."
            },
            {
                "name": "network-anomaly",
                "title": "Network Anomaly",
                "parent": "network",
                "description": "Network anomaly indicators trigger when some strange behavior is detected within the network. This includes items detected through a network detection system (Snort) or patterns associated with unusual or malicious network activity. The patterns are not necessarily malicious, but deserve some attention."
            },
            {
                "name": "network-information",
                "title": "Network Information",
                "parent": "network",
                "description": "Network information indicators show basic network traffic material. These are most helpful in highlighting less common network protocols, notices and errors. Examples are noting FTP traffic, HTTP redirects and 404 notices. These are not malicious behaviors, but are useful to build a profile for malware or to determine if something is missing."
            },
            {
                "name": "rat",
                "title": "Remote-Access Trojan (RAT)",
                "parent": "malware",
                "description": "A Remote-Access Trojan (RAT) is a specific type of trojan malware that opens a backdoor on the system, allowing an attacker to access the system. Sometimes, this access is limited to a small set of commands, such as data collection and exfiltration. Other times, it provides the attacker to download additional material or execute commands on the system. RATs may also provide a way for an attacker to set up a bot network for a distributed attack or redirection for misattribution."
            },
            {
                "name": "trojan",
                "title": "Trojan",
                "parent": "malware",
                "description": "Trojan malware is any program that requires the user to launch that proceeds to do some malicious activity to the system. They are named for the Trojan Horse, which needed to be brought within the walls to be effective. Trojans do not execute themselves, but may have many sub-processes to perform their tasks. Many will set up persistence mechanisms to restart themselves on a system reboot. Trojans are used for a wide variety of tasks, such as spying on users, remote access to the system, the starting process for a bot or ransomware, data or credential theft and so on."
            },
            {
                "name": "download",
                "title": "Download",
                "parent": "network",
                "description": "Download indicators trigger when information is sent to the system from a remote location. Legitimate processes do this often, gathering data needed for a program, updating information on the system, and so on. Installers may do this to get the most recent version of a program from the server. Malware downloads material that can be used for the next stage of an attack, such as commands, configurations or complete programs."
            },
            {
                "name": "process",
                "title": "Process",
                "parent": null,
                "description": "Process indicators are those that trigger based on some dynamic activity observed during a sample run. They draw attention to behaviors that may or may not be common on a running system, but are helpful for building up the profile of activity done by a malicious file. Process indicators can sometimes be evaded through certain tricks, designed to identify sandbox environments. On the other hand, many of these tricks can be themselves detected."
            },
            {
                "name": "attribute",
                "title": "Attribute",
                "parent": "static",
                "description": "An Attribute indicator draws attention to a characteristic of a file. These are not anomalies, but simple items that are part of the makeup of a file. Examples of this are the presence of a code certificate, encrypted sections or the presence of a new task file. This category also includes packers and installers. Packers attempt to better compress executable code, making a smaller executable file. Installers provide a series of automated steps that integrate a file into the operating system."
            },
            {
                "name": "code-injection",
                "title": "Code Injection",
                "parent": "process",
                "description": "Code injection indicators trigger when there is reason to believe that code was injected into a process, or when potentially malicious code was loaded by a process. These injections may include things like process hollowing, using read/write/execute areas of memory or AtomBombing. The code loading exposes DLL side-loading techniques."
            },
            {
                "name": "error",
                "title": "Error",
                "parent": "process",
                "description": "Error indicators trigger when the process or system enters an invalid state, resulting in a 'crash'. Most often, Windows will collect information about the system at the time into a report and offer to send it to Microsoft for analysis. Program or system crashes may occur for a variety of reasons and are not necessarily malicious. Malware may inadvertently trigger a crash if attempting to do an action on the wrong version of a program or operating system. All crashes suggest some unexpected event and are therefore logged in indicators."
            },
            {
                "name": "weakening",
                "title": "Weakening",
                "parent": "process",
                "description": "Indicators in this category detect when a process changes something on the system that leaves it more vulnerable to attack. Some will modify the registry to allow execution under broader circumstances or to disable security checks and programs. Others will kill or uninstall defensive programs, the system firewall or scheduled backups. Still others may add themselves to special permissions lists or the trusted DNS. Malware very often weakens the system to hinder forensic or recovery efforts or as a simple means of evasion."
            },
            {
                "name": "static-anomaly",
                "title": "Static Anomaly",
                "parent": "static",
                "description": "Static Anomaly indicators highlight files that have some characteristic that is out of the ordinary or of particular interest to an investigator. These are not necessarily malicious patterns or obfuscation. Some anomalies may be an accident of the program that made the file. Most often, it exposes some detail that can be combined with other information to build a malicious profile. A few examples: text-based files with high entropy, documents that use base-64 encoded buffers within the metadata or executables that have improper checksums."
            },
            {
                "name": "dropper",
                "title": "Dropper",
                "parent": "malware",
                "description": "A dropper is a program that unpacks or downloads a malicious payload. These programs are often difficult to classify as malicious, because their behavior is closely related to installers. A dropper is often a specialized form of malware trojan that does only one task, gather the material for the next stage of the attack. Encryption of the embedded payload or the download traffic often prevent the program from being declared malicious until it has already unpacked or downloaded the next stage. Many droppers are used for a variety of purposes, but some are exclusively used for malware."
            },
            {
                "name": "anti-analysis",
                "title": "Anti-Analysis",
                "parent": "process",
                "description": "Anti-analysis indicators trigger when a process in the sample does a check for anti-virus tools or detection for a sandbox. Legitimate programs that are designed to protect proprietary information will sometimes employ sandbox detection. Malware will sometimes use these checks to take different code execution paths or stop functioning entirely, in order to avoid exposing their execution patterns. Often, malware will attempt to identify and kill running anti-virus programs so that their own execution is unhindered."
            },
            {
                "name": "toolkit",
                "title": "Toolkit",
                "parent": "malware",
                "description": "A malware toolkit is a program or set of code libraries that are almost always used by an attacker for malicious purposes. These tools may be commonly available, distributed among attackers (malware-as-a-service). Others are marketed tools that can easily be bent to malicious ends (such as keyloggers)."
            },
            {
                "name": "anti-forensics",
                "title": "Anti-Forensics",
                "parent": "process",
                "description": "Anti-forensic indicators trigger when a process destroys information that may be needed for forensics later. These are not always malicious, as legitimate programs may delete files or even other programs as a clean-up stage. Malware does things like delete the original program file or destroy scripts that performed the downloading steps to prevent the analysis of those files."
            },
            {
                "name": "network",
                "title": "Network",
                "parent": null,
                "description": "Network categories and their indicators are used when the sample has some interaction through the network beyond a standard startup. Network communication is obviously very common and sharing of information through corporate networks and the Internet is standard practice. These indicators draw attention to particular traffic patterns and streams. They operate on the network material alone, without reference to detailed static or dynamic process information."
            },
            {
                "name": "network-enumeration",
                "title": "Network Enumeration",
                "parent": "network",
                "description": "Network enumeration indicators trigger when some attempt is made to learn more about the host or the local network. Legitimate samples may do some detection to determine simple things, but will most often rely on the system information. Malware performs these as a set of checks for known sandbox environments, corporate IP address ranges and potential targets."
            },
            {
                "name": "domain",
                "title": "Domain",
                "parent": "network",
                "description": "Domain indicators center around information about domain names used during the sample run. Noted domains may be checked against domain databases for known malicious activity or other categorization. Domains are relatively stable for well-known services, but change frequently for malicious material. Indicators in this category may be used to highlight either well-known domains, services or unusual and known malicious patterns."
            },
            {
                "name": "data-theft",
                "title": "Data Theft",
                "parent": "malware",
                "description": "Data theft malware is a program that seeks to steal sensitive information from the user. This information could be things like email lists, user names and passwords or proprietary company information. User information is very valuable and can be used to further an attack, find new targets or for sale to an interested party. Data theft that involves bank or credit information is classified as Banking malware."
            },
            {
                "name": "system-enumeration",
                "title": "System Enumeration",
                "parent": "process",
                "description": "System enumeration indicators detect when a process is gathering information about the system. Most often, this is done through standard programs or processes already available to the operating system. The tools are for system administrators to list programs, system settings, hardware and so on. Malware may run these checks to learn about the target and determine if it can run in the environment. Sometimes, this information is sent to the attacker. At other times, it is used to detect sandboxes or anti-virus programs."
            },
            {
                "name": "pattern",
                "title": "Pattern",
                "parent": "sample",
                "description": "Pattern indicators collect together aspects from static, dynamic and network material to find items that are odd when seen together. This encompasses a wide range of material, from documents that check for the local IP, to misspelled names for Windows utilities to the sample being modified and then deleted. The context of the events occurring is very important to these indicators and the same behavior may not be malicious if the circumstances are changed. For instance, running powershell with the encoded option is common, but a shortcut file launching such a powershell is much more suspicious."
            },
            {
                "name": "malware",
                "title": "Malware",
                "parent": null,
                "description": "Items within the Malware categories are known malicious items, patterns and tools. These items should be considered undesirable at all times and their scores should always be within a conviction range."
            },
            {
                "name": "exhaustion",
                "title": "Exhaustion",
                "parent": "sample",
                "description": "Exhaustion indicators trigger when the sample has displayed a great deal of activity in a certain area. These are commonly associated with sandbox evasion, where the analyst is overwhelmed with information and the suspicious actions are buried within benign actions. In other cases, the sample attempts to perform a large number of actions that indicate attempts to reach a command-and-control."
            },
            {
                "name": "ransomware",
                "title": "Ransomware",
                "parent": "malware",
                "description": "Ransomware is a malicious program that hides or encrypts user data and demands a ransom to restore it. These types of attacks became very popular over the past few years, with many variants using different encryption methods and means of preventing data recovery through other means. Ransomware will typically limit targeted files to certain extensions, so that the system remains operable. The filetypes usually include documents, pictures, gaming information, databases, etc."
            },
            {
                "name": "banker",
                "title": "Banking",
                "parent": "malware",
                "description": "Banking malware is a combination of malicious material with the end goal of stealing money from a user. This could be through collecting of user credentials from the file system, monitoring user activity for point-of-sale transactions that may expose credit information or other snooping techniques. Banking malware is related to data-theft malware in that it gathers and exfiltrates sensitive user data."
            },
            {
                "name": "macros",
                "title": "Macros",
                "parent": "static",
                "description": "Macros are special script files that exist inside a parent file and expose additional API not normally available to that script language. This includes items like Microsoft Office macros, embedded within Word and Excel, or JavaScript within a PDF. Macros allow common tasks or specialized display within a document. It may give the user the ability to fill in information or calculate values within a spreadsheet. Malware authors commonly use macros as a means of getting past basic email filters to deliver the first stage of the attack."
            },
            {
                "name": "worm",
                "title": "Worm",
                "parent": "malware",
                "description": "A worm is a program that propagates itself to other hosts, dropping copies of itself in places that will help it to spread. A worm is different from a virus, in that it will seek to start itself when entering a new environment. This type of malware seeks out network shares, removable drives and remote hosts that it can infect. It will often modify auto-start capabilities to ensure launch on the remote targets."
            },
            {
                "name": "information",
                "title": "Information",
                "parent": "process",
                "description": "Informational indicators draw attention to operating system utilities that were executed during the sample run. They do not suggest malicious use, but provide information about the function of these tools and their proper usage. These indicators are most useful as additional data points when building a profile of a malware attack. Many malicious processes will attempt to use already-installed tools (live-off-the-land) so that further downloads can be kept to a minimum."
            },
            {
                "name": "pua",
                "title": "Potentially Unwanted Applications (PUA)",
                "parent": "malware",
                "description": "PUA are programs that do some activity that the user may find disruptive. In general, the application itself is not malicious. Many do simple things, like display ads to the user, adjust the page displayed when opening a browser, or install small utilities like search bars. Most often, PUA come packaged with other applications that the user does want and are installed silently along with the desired program. PUA may track user activity and send information back to a remote host for analysis."
            },
            {
                "name": "feeds",
                "title": "Feeds",
                "parent": null,
                "description": "These indicators trigger as a sign that the sample is part of an automated feed."
            },
            {
                "name": "dynamic-anomaly",
                "title": "Dynamic Anomaly",
                "parent": "process",
                "description": "Dynamic anomalies are indications of when a process is doing something that is very unusual. Programs within operating systems are able to perform an unimaginable number of different tasks. However, some of these items are very rare or are often associated with undesirable behavior. Anomalous behavior is therefore not necessarily malicious, but deserves some attention or notation. Examples of anomalous behavior include modifying the remote-desktop settings, adding extremely large values to the registry, modifying user settings or spawning multiple child processes."
            },
            {
                "name": "creation",
                "title": "Creation",
                "parent": "process",
                "description": "Programs create many files and registry entries in their ordinary operation. Items within this category draw attention to uncommon creation events, such as adding a new user, creation of scripts or executables within certain areas of the system. These events may be benign, but provide additional information for building a profile on malicious samples."
            },
            {
                "name": "exploit",
                "title": "Exploit",
                "parent": "static",
                "description": "An exploit is a known static pattern within a file that can be used to gain additional privileges or code execution. These are mapped publicly as Common Vulnerabilities and Exposures (CVE). Exploit indicators attempt to detect when these exploitable situations are used for illegitimate purposes."
            },
            {
                "name": "virus",
                "title": "Virus",
                "parent": "malware",
                "description": "A virus is a program that propagates itself on a system, infecting files with its own code. It is differentiated from other basic malware types in that it does not run itself and it does not spread itself to other hosts intentionally. Virus programs position themselves to execute first by changing the starting address in an executable, or adding an initialization macro in other files. This allows the virus code to spread itself to other nearby files, but does not otherwise disrupt the execution of the infected program or file. The virus may perform other tasks in addition to the file infection."
            },
            {
                "name": "spreading",
                "title": "Spreading",
                "parent": "sample",
                "description": "Spreading indicators trigger when the sample is attempting to send itself to areas beyond the host. This includes efforts to send the file to a removable drive or through the network. It also includes other modifications to the sample itself that attempt to mutate it and avoid fingerprinting by an anti-virus engine."
            },
            {
                "name": "sample",
                "title": "Sample",
                "parent": null,
                "description": "Sample categories and indicators are those that use pieces of information from different areas of the sample. They are items that do not operate or make sense without additional contextual information provided by the sample as a whole."
            },
            {
                "name": "embedded",
                "title": "Embedded",
                "parent": "static",
                "description": "Embedded indicators detect files or resources that are stored within a parent file. Many file types support some form of embedding related data that can be extracted later or for a specialized display. Embedding files makes it easier to share a single file that uses independent data with colleagues. Embedded files are common, but some can also be very suspicious. For instance, an Office document that contains an embedded script file is quite uncommon, since Office already supports macros. Malware authors may use embedded content within a document type to get past basic email filters. They may embed material within a binary file to avoid simple detection by anti-virus utilities."
            },
            {
                "name": "evasion",
                "title": "Evasion",
                "parent": "process",
                "description": "Evasion indicators suggest when a process is doing some action to avoid common detection patterns. This includes things like storing executables in areas not checked by AV scans, in-memory unpacking or obfuscation of the process command-line. Malware very often employs evasion techniques, many of which overlap with other categories, such as system weakening."
            },
            {
                "name": "persistence",
                "title": "Persistence",
                "parent": "process",
                "description": "Persistence indicators suggest when a process modifies the system so that a program will be executed again on a common event. There are multiple ways to schedule an automatic execution of a program, such as at system reboot, launching of a browser, or at process exit. These can be enabled by dropping a file in a certain directory, modifying the registry or even modification of the boot process. Legitimate programs may add themselves through these means to reconnect to outside resources, such as a network printer. Malware will do this to guarantee that it can restart if the system is shut down or the program is terminated."
            },
            {
                "name": "obfuscation",
                "title": "Obfuscation",
                "parent": "static",
                "description": "Obfuscation indicators trigger when there is reason to believe that the file employs some mechanism to make static analysis more difficult. In binary files, this could be some form of indirect execution, such as reflective loading. More commonly, it detects patterns within text-based files, such as scripts, that are intended to mask a known malicious pattern. This could be things like encoding string characters in their hexadecimal equivalent, adding in 'junk code' that is never executed or using formatting that breaks static analyzers but not the target application."
            }
        ]
    }
}

